! logo.asm
! Draws a logo to the arcvm display device.

	.begin
	.org 2048
	sethi 0x3fffc0, %r1	! set r1 to the IO offset

	V_COLOR .equ 0xF1
	V_CMD .equ 0xF2
	V_ADDR_X .equ 0xF4
	V_ADDR_Y .equ 0xF8

	SCREENW .equ 320
	SCREENH .equ 240
	IMAGE_W .equ 104	! In pixels
	IMAGE_H .equ 51       	! In pixels
	
init:	
	ld [white], %r4		! %r4 = the color (white)
	or %r0, 0, %r2		! %r2 = the x coord
	or %r0, 0, %r3		! %r3 = the y coord
	or %r0, 0, %r9		! %r9 = data offset

	or %r0, 0, %r12		! %r12 = the x offset
	or %r0, 0, %r13		! %r13 = the y offset
nexty:
	subcc %r3, IMAGE_H, %r0
	be done

	inc %r3
	or %r0, 0, %r2
loop:
	subcc %r2, IMAGE_W, %r0
	be nexty

	ldsb [%r9 + logo], %r6

	add %r2, 100, %r12
	add %r3, 90, %r13
	st %r12, [%r1+V_ADDR_X]
	st %r13, [%r1+V_ADDR_Y]
	stb %r6, [%r1+V_COLOR]
	add %r2, 1, %r2
	add %r9, 1, %r9		! Increase data offset

	ba loop
done:
	st %r6, [%r1+V_CMD]
	halt
white:	0xFFFFFFFF
one:	0xFF000000
two:	0x00FF0000
three:	0x0000FF00
four:	0x000000FF
